About Job:
About the job
BeaconFire is based in Central NJ, specializing in Software Development, Web Development, and Business Intelligence; we are looking for candidates who are passionate about combining technology and design to create user-friendly websites.

Responsibilities:
· Develop websites using HTML, CSS, Node.js, React.js, and Angular2+, among other tools;
· Write scalable, secure, maintainable code that powers our clients’ platforms;
· Create, deploy, and maintain automated system tests;
· Work with Testers to understand defects opened and resolve them in a timely manner;
· Supports continuous improvement by investigating alternatives and technologies and presenting these for architectural review;
· Collaborate effectively with other team members to accomplish shared user story and sprint goals;
· Invest time in constant professional development to stay up to date with new technological developments and programming languages;
· Discover and fix programming bugs;
· Other duties as assigned.

Basic Qualifications:
· Proficient understanding of HTML and CSS;
· Experience in programming language JavaScript or similar (e.g. Java, Python, C, C++, C#, etc.) and understanding of the software development life cycle;
· Basic knowledge of code versioning (e.g. Git, SVN);
· A passion for coding pixel-perfect web pages;
· Good verbal communication and interpersonal skills.

Preferred Qualifications:
· Bachelor's degree or higher in Computer Science or related fields;
· 0-1 year of practical experience in JavaScript coding;
· Familiarity with at least one JavaScript framework (Angular2+, React.js, Express.js);
· Experience with unit and integration testing of code, with an understanding of JavaScript testing frameworks like Jasmine, Cucumber, Mocha, and Karma;
· Experience providing REST/SOAP APIs for user interface consumption;
· Experience working within an Agile development methodology Scrum.

BeaconFire is an E-verified company and work - Visa Sponsorship is Available.

About the job
We are looking for a React Developer to join our team!

You'll be working on the international projects for a company-provider of an audit, consulting and financial advisory from the USA. Our team consists of: Technical Delivery Manager, Business Systems Analyst, Developers, QA Engineers (up to 15 people).

Requirements:

 3+ years of experience with React;
 Experience with React Hooks (React 16.8+);
 Experience with state management libs (Redux, Redux Toolkit);
 Knowledge of Typescript;
 Testing with Jest + React Testing Library;
 Basic knowledge of HTML5/CSS;
 Experience in application frontend scalability, performance and security;
 Taking part in architecture design solutions;
 Participating in feature grooming;
 English - Upper-Intermediate;


Will be plus:

 Experience with Webpack;


Responsibilities:

 Feature development;
 Taking part in architecture design solutions;
 Participating in feature grooming;
 Communication with other team layers: BE, SQL, BA, QA, designers;
 Bug fixing


What we offer:

Paid training programs and English/Spanish language courses;
Medical insurance, sports program compensation and other benefits compensation program;
Comfortable working hours;
Awesome team events and a wide variety of knowledge sharing opportunities


Who we are:

We are TRINETIX — a dynamic, rapidly growing technology organization with approximately 900 representatives in Europe, the United States, and Ukraine, who bring their passion, skill & innovation to ensure our organization provides products that meet the needs of our partners, and clients.

We offer IT solutions to business enterprises of various sizes and industries using the latest cutting edge technologies. We assist our clients and partners in improving work processes, making them more efficient, while keeping the essential objectives in focus. We serve and support various business entities, enterprises, and startups globally, to grow and stay competitive in the digital era. We achieve this incredibly important goal by efficiently implementing tech innovation, substantial professional expertise, and a solution-driven strategy.

